Tava e-veselība Tavās rokās.
Burtiski

eVeselībasPunkts ir Tavs palīgs e-veselībā:
-	izmanto eVeselībasPunkta profilu; 
-	izsauc neatliekamo medicīnisko palīdzību (NMPD);
-	nosūti savu zvanītāja atrašanās vietu (GPS koordinātas) NMP dispečeram (tikai atrodoties Latvijas teritorijā);
-	uzzini lokālo ārkārtas numuru, atrodoties ārpus Latvijas teritorijas;
-	veic zvanu savam ģimenes ārstam vai uz konsultatīvo ģimenes ārsta tālruni;
-	kartē atrodi tuvāko medpunktu;
-	zvani uz medpunkta tālruni;
-	saņem norādes līdz medpunktam;
-	lietot lietotni vairākās valodās.

eVeselībasPunkts ir integrēts ar Latvijas Republikas Neatliekamās Medicīniskās Palīdzības Dienestu.

----

Your e-health in your own hands.
Literally.

eHealthPoint is your helper in e-health:
-	use your eHealthPoint profile;
-	call the Emergency medical service (EMS);
-	send the location of the caller (GPS coordinates) to the EMS dispatcher (for now - only in Latvia); 
-	find out local emergency number when outside Latvia;
-	make call to the family doctor or the family doctors’ consultative line;
-	find the nearest medical point on the map;
-	call the medical point;
-	receive directions to the medical point;
-	use the application in multiple languages.

eHealthPoint is integrated with the Emergency Medical Service of Latvia.

----

Твоё э-здоровье в Твоих руках.
Буквально.

eVeselībasPunkts - Твой помощник в э-здоровье:
-	используй свой профиль eVeselībasPunkts
-	вызывай неотложную медицинскую помощь (НМП);
-	отправляй диспетчеру НМП местоположение (GPS координаты) лица, осуществляющего вызов (только в Латвии);
-	узнай номер неотложной помощи в стране, в которой находишься;
-	звони своему семейному врачу или по консультативному номеру телефона семейных врачей;
-	найди на карте ближайший медпункт;
-	звони по номеру медпункта;
-	проложи маршрут до медпункта;
-	используй приложение на нескольких языках.

Приложение eVeselībasPunkts интегрировано с информационной системой Неотложной Медицинской Помощи Латвии.

The PICOOC Smart Body Fat Scale that can take 13 body measurements 

The PICOOC Smart Body Fat Scale uses advanced high-precision weight sensor and high-speed fat-measuring microchip to collect body data. Using the PICOOC Smart Body Fat Scale, you can immediately synchronize 13 important body measurements such as weight, body fat percentage, and visceral fat index. The App will also conduct data mining and analysis to provide you with recommendations and services for you to better understand your body. 

The smart, easy-to-use body index monitoring App provides you with the following features 
— Weighing and measuring: With the PICOOC Smart Body Fat Scale, you can obtain 13 body measurements such as weight and body fat percentage; 
— Interpretation of body measurements: It provides you with a detailed description of your 13 body statistics and their current status; 
— Historical measurement data: A list shows the history of all measurement records; 
— Trend records: Line diagrams show your weight, body fat percentage, muscle percentage, body circumference, and other measurements; 
— Profound analysis: It provides a profound analysis of your health indicators based on powerful data models developed for different human body compositions, reminding you about the measurements needed the most attention or improvement in a timely manner; 
— Body circumference records: It can record 6 body circumference measurements such as waist circumference, hip circumference, and chest circumference. It can also analyze your waist-hip ratio and body type based on your body circumference and weight data. 
— Linking the Apple "Health" App: Once the PICOOC App is linked to the Apple Health App, every time a measurement is taken, it can be synchronized with Apple Health.Make the associated settings in the [Me]-[Settings]-[Apple health settings].
—Blood pressure measurement: With the PICOOC Smart Blood Pressure Monitor, you can immediately synchronize many important blood pressure measurements such as systolic blood pressure, diastolic blood pressure, pulse and other indicators;
—Interpretation of blood pressure indicators: The evaluation is based on the medical guidelines issued by local country. The evaluation results in the app are non-diagnostic conclusions. Before making any medical decision, please consult your doctor for guidance and advice.
